function resetCurrent(latitude, longitude, speed) {
	var newPosition = new google.maps.LatLng(latitude, longitude);
	//var newPosition = new google.maps.LatLng(47.6227572, -122.3474877);
	//speed = 3.374492;
	var newSpeed = 60 / ( speed * 2.23693629 );
	var minutes = Math.floor(newSpeed);
	var seconds = Math.round((newSpeed - minutes) * 60);
	if (isNaN(minutes) || isNaN(seconds)) {
		minutes = 0;
		seconds = 0;
	}
	if (seconds < 10)
		seconds = "0" + seconds;
	var parsedSpeed = minutes + ":" + seconds;
	var currentIcon = 'current.png';
	var newMarker = new google.maps.Marker({
		position: newPosition,
		title: parsedSpeed + " min/mi pace",
		icon: currentIcon,
		map: map
	});
	if (firstLoad) {
		map.setCenter(newPosition);
		firstLoad = false;
	}
	if (currentMarker.length > 0)
		currentMarker.pop().setMap(null);
	currentMarker.push(newMarker);
}

function updateTimer() {
	updateTracker();
	var t = setTimeout("updateTimer()", 5000);
}
